import ColorFilterItem from "./ColorFilterItem";

function ColorFilter() {
  const colors = ["black", "blue", "green", "red"];
  return (
    <ul>
      {colors.map((color) => (
        <ColorFilterItem color={color} />
      ))}
    </ul>
  );
}

export default ColorFilter;
